DROP TABLE IF EXISTS `esperienze_lavorative`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `esperienze_lavorative` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `id_esperti` int(10) unsigned NOT NULL,
  `data_inizio` date NOT NULL,
  `data_fine` date DEFAULT NULL,
  `in_corso` tinyint(1) NOT NULL,
  `ruolo` varchar(255) DEFAULT NULL,
  `attivita_lavorative` varchar(600) DEFAULT NULL,
  `tipo_esperienza` varchar(255) DEFAULT NULL,
  `datore_lavoro` varchar(255) DEFAULT NULL,
  `id_tipo_professione` int(10) DEFAULT NULL,
  `id_professione` int(10) DEFAULT NULL,
  `id_datore_di_lavoro` int(10) DEFAULT NULL,
  `flag_carriera` tinyint(1) NOT NULL DEFAULT '0',
  `flag_principale` tinyint(1) NOT NULL DEFAULT '0',
  `id_specializzazioni_1` int(10) unsigned DEFAULT NULL,
  `id_specializzazioni_2` int(10) unsigned DEFAULT NULL,
  `id_specializzazioni_3` int(10) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_esperienze_lavorative_esperti` (`id_esperti`),
  KEY `fk_id_tipo_professione_idx` (`id_professione`),
  KEY `fk_id_datore_di_lavoro_idx` (`id_datore_di_lavoro`),
  KEY `fk_id_tipo_professione` (`id_tipo_professione`),
  KEY `fk_id_specializzazioni_1_idx` (`id_specializzazioni_1`),
  KEY `fk_id_specializzazioni_2_idx` (`id_specializzazioni_2`),
  KEY `fk_id_specializzazioni_3_idx` (`id_specializzazioni_3`),
  CONSTRAINT `FK_esperienze_lavorative_esperti` FOREIGN KEY (`id_esperti`) REFERENCES `esperti` (`id`),
  CONSTRAINT `fk_id_datore_di_lavoro` FOREIGN KEY (`id_datore_di_lavoro`) REFERENCES `datore_di_lavoro` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_id_professione` FOREIGN KEY (`id_professione`) REFERENCES `professione` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_id_specializzazioni_1_el` FOREIGN KEY (`id_specializzazioni_1`) REFERENCES `specializzazioni` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_id_specializzazioni_2_el` FOREIGN KEY (`id_specializzazioni_2`) REFERENCES `specializzazioni` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_id_specializzazioni_3_el` FOREIGN KEY (`id_specializzazioni_3`) REFERENCES `specializzazioni` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_id_tipo_professione` FOREIGN KEY (`id_tipo_professione`) REFERENCES `tipo_professione` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=1439 DEFAULT CHARSET=latin1;
