DROP TABLE IF EXISTS `esperti`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `esperti` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `username` varchar(16) NOT NULL,
  `password` varchar(16) NOT NULL,
  `email` varchar(120) NOT NULL,
  `nome` varchar(45) NOT NULL,
  `cognome` varchar(45) NOT NULL,
  `cf` varchar(16) NOT NULL,
  `tel` varchar(45) DEFAULT NULL,
  `dataNascita` longtext,
  `domicilio` longtext,
  `residenza` longtext COMMENT 'Non piÃ¹ utilizzata',
  `data_modifica` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `fax` varchar(45) DEFAULT NULL,
  `cellulare` varchar(45) DEFAULT NULL,
  `piva` varchar(11) DEFAULT NULL,
  `codice_domanda` varchar(80) NOT NULL,
  `inviato` tinyint(1) unsigned NOT NULL,
  `privacy` tinyint(1) NOT NULL,
  `admin` tinyint(1) NOT NULL DEFAULT '0',
  `stato` int(10) unsigned NOT NULL DEFAULT '3',
  `data_invio` timestamp NULL DEFAULT NULL,
  `residenza_regione` varchar(2) DEFAULT NULL,
  `residenza_paese` varchar(3) DEFAULT NULL,
  `residenza_provincia` varchar(3) DEFAULT NULL,
  `residenza_citta` int(10) unsigned DEFAULT NULL,
  `cap` varchar(5) DEFAULT NULL,
  `competenza` longtext,
  `nascita_citta` int(10) unsigned DEFAULT NULL,
  `nascita_paese` varchar(3) DEFAULT NULL,
  `nascita_provincia` varchar(3) DEFAULT NULL,
  `nascita_regione` varchar(2) DEFAULT NULL,
  `presentazione` varchar(3000) DEFAULT NULL,
  `candTrasmessa` tinyint(1) DEFAULT NULL,
  `citta` varchar(250) DEFAULT NULL,
  `citta_nascita` varchar(250) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `esperti_fk` (`stato`),
  KEY `fk_residenza_regione_idx` (`residenza_regione`),
  KEY `fk_residenza_paese_idx` (`residenza_paese`),
  KEY `fk_residenza_provincia_idx` (`residenza_provincia`),
  KEY `fk_residenza_citta_idx` (`residenza_citta`),
  KEY `fk_nascita_citta_idx` (`nascita_citta`),
  KEY `fk_nascita_paese_idx` (`nascita_paese`),
  KEY `fk_nascita_provincia_idx` (`nascita_provincia`),
  CONSTRAINT `esperti_fk` FOREIGN KEY (`stato`) REFERENCES `stato_esperti` (`id`),
